webpackJsonp([0xf927f8900006],{391:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Gatsby Starter Blog",author:"Konstantinos Leimonis"}},markdownRemark:{id:"/home/travis/build/leimonio/leimon.io/src/pages/about/index.md absPath of file >>> MarkdownRemark",html:'<p>My name is Konstantinos, a 27 years old software engineer 🤖, working for <a href="https://hostmaker.com/" target="_blank">Hostmaker</a> as a full-stack engineer, on the Javascript stack using NodeJS, React, Redux.\nI recently moved in 📍Bristol (UK) no matter how much I appreciate sunny weather ☀️, like there used to be in my hometown, Athens (Greece) 🏖.</p>\n<p>My background comes from a typical CS graduate degree, that started with programming in Java, moved to PHP, Javascript and Python.\nThroughout my professinal experience I have developed skills around creating, developing and consluting user-centric products.</p>\n<p>I love travelling and exploring new destinations, and i’m keen in sports like snowboarding.</p>\n<p>If you want to learn more or just say hi, <a href="mailto:hey@leimon.io?subject=%F0%9F%91%8B%20My%20name%20is%20__">drop me a line</a> or find me on Twitter as <a href="https://twitter.com/leimonio" target="_blank">@leimonio</a>.</p>',frontmatter:{title:"Hey 👋, glad to have you here!",date:"May 12, 2018"}}},pathContext:{slug:"/about/",previous:{fields:{slug:"/hi-folks/"},frontmatter:{title:"New Beginnings",isArticle:!0}},next:{fields:{slug:"/react-europe-2018/"},frontmatter:{title:"React Europe 2018  ⚛️ 🇪🇺 - TLDR;",isArticle:!0}}}}}});
